import { Component } from '@angular/core';

@Component({
  selector: 'app-home-page',
  templateUrl: './home-page.component.html',
  styleUrls: ['./home-page.component.css']
})
export class HomePageComponent {
  searchItem:string="hello";
  searcher()
  {
    console.log(this.searchItem);
  }
}
<html>
<head></head>
<body>
    <nav class="navbar navbar-light bg-dark justify-content-between">

            <a class="navbar-brand text-light">Ecommerce Site</a>
            <form class="form-inline" (ngSubmit)="searcher()">
              <input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search" style=" width: 425.6px; " [(ngModel)]="searchItem">
              <button class="btn btn-outline-success my-2 my-sm-0" type="submit" (click)="searcher()">Search</button>
            </form>
        <div>
            <button type="button" class="btn btn-success" style="margin-right: 10px;" [routerLink]="['/login']">Login</button>
            <button type="button" class="btn btn-primary" [routerLink]="['/signup']">Sign up</button>
        </div>

      </nav>
</body>
</html>
